import {useEffect, useState} from 'react';
import '../node_modules/bootstrap/dist/css/bootstrap.css';
import axios from 'axios';


function DisplayPg()
{
    var [pg, setPg] = useState([]);
    var [pgs,setPgs] = useState({pg_Image:"", pg_name:"", pg_type:"", pg_city:"", pg_isVacaent:"", pg_rent:"", pg_address:"",pg_foodType:""});
    useEffect(()=>{
        Select();
    }, []);


    var Select=()=>{
        const owner_id = sessionStorage.getItem("owner_id")
        axios.get("http://localhost:5000/admin/viewpg"+owner_id).then((result)=>{  //here we have to write owner id
        console.log(owner_id)    
        setPg(result.data.data);
            console.log(result)
        })
    }


    return(
        <>
        <div className='table-responsive'>

            <table className='table table-bordered'>
                <thead>
                    <th>pg_Image</th>
                    <th>pg_name</th>
                    <th>pg_type</th>
                    <th>pg_city</th>
                    <th>pg_isVacaent</th>
                    <th>pg_rent</th>
                    <th>pg_address</th>
                    <th>pg_foodType</th>
                </thead>
                <tbody>
                 {
                    pg.map((pg)=>{
                        return <tr>
                            <td>{pg.pg_Image}</td>
                            <td>{pg.pg_name}</td>
                            <td>{pg.pg_type}</td>
                            <td>{pg.pg_city}</td>
                            <td>{pg.pg_isVacaent}</td>
                            <td>{pg.pg_rent}</td>
                            <td>{pg.pg_address}</td>
                            <td>{pg.pg_foodType}</td>
                    </tr>
                    })
                }
                </tbody>
            </table>

        </div>

        </>
    )
}

export default DisplayPg;
